  [],\n\t\"num_tags\": 0,\n\t\"name\": \"afsc-nmml-video-analysis-for-group-count-and-calf-proximity-of-beluga-whales-in-cook-inlet-2014\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"As a part of NMFS management of the endangered
  beluga whale population in Cook Inlet, Alaska, aerial surveys have been conducted
  during summer since 1993 to monitor their distribution and abundance.  When beluga
  whale groups are found, observers make counts from the bubble windows while one
  observer records the group with a video camera.  The video has been used to count
  the number of animals in the group to correct for missed animals in the observer
  counts.  In 1996, a second video camera was added; the first video camera had a
  lens set at a wide angle to view the entire beluga group while the second video
  camera was zoomed to approximately 10x to magnify a subsample of individual whales
  in the group.  The zoomed video has been used to examine color ratios of white adults
  relative to smaller and darker juveniles and calves and correct for those individuals
  missed due to their size or coloration.  In 2005, a computer program was designed
  to digitize the process for analyzing the video, which had been conducted manually
  prior to that year.  The program allows an analyst to digitally mark and number
  each individual whale image, track it across the screen, and measure relative whale
  size.  The dataset described here includes the data from the years that video was
  analyzed using the computer program, 2005-2012, and 2014. The annual survey switched
  to a biennial survey starting in 2012, therefore there is no data for 2013.\",\n\t\"owner_org\":
